/**
* create_graph() from table data
* @table array
* @description 
* 1. takes as input an array of arrays
* 2. disperses them into nodes and edges
* 3. Tracks occurrences and increments values 
*/
function create_graph(table){
  // dataset to build
  var dataset = { "nodes": [], "edges": [] };
  //var dataset = { "nodes": [], "edges": []};
  // track nodes
  var node_order = [];

  // loop through each row of table
  var counter = 0;
  for (i in table){

    var n1 = table[i][0].toLowerCase();
    var n2 = table[i][1].toLowerCase();
    var n3 = parseInt(table[i][2]);

    // if node1 does not exist 
    if (node_order.indexOf(n1) < 0){
      // track it
      node_order.push(n1);
      // and create it in dataset
      dataset.nodes.push({ 
        "name": n1, 
        "value": 1,
        "node": 1,
        "index": counter,
        "flag": true,
        "group": n3
      });
      counter = counter + 1;
    } else {
      // else update 
      var num = node_order.indexOf(n1)
      dataset.nodes[num].value ++;
    }

    // if node2 does not exist 
    if (node_order.indexOf(n2) < 0){
      // track it
      node_order.push(n2);
      // and create it in dataset
      dataset.nodes.push({ 
        "name": n2, 
        "value": 1,
        "node": 2,
        "index": counter,
        "flat": true,
        "group": n3
      });
      counter = counter + 1;
    } else {
      // else update 
      var num = node_order.indexOf(n2)
      dataset.nodes[num].value ++;
    }

    // push edges 
    dataset.edges.push({ 
      "source": node_order.indexOf(n1), 
      "target": node_order.indexOf(n2),
      "group": n3,
      "flag": true,
      "value": dataset.nodes[node_order.indexOf(n1)].value * dataset.nodes[node_order.indexOf(n2)].value
    });

//Zoom and Drag Source Code: bl.ocks.org/mbostock/6123708
function zoomed() {
  container.attr("transform", "translate(" + d3.event.translate + ")scale(" + d3.event.scale + ")");
}

function dragstarted(d) {
  d3.event.sourceEvent.stopPropagation();
  d3.select(this).classed("dragging", true);
}

function dragged(d) {
  d3.select(this).attr("cx", d.x = d3.event.x).attr("cy", d.y = d3.event.y);
}

function dragended(d) {
  d3.select(this).classed("dragging", false);
}
